def getRefCodeByNameOne(refs: list, name: str):
    """
    Получение кода значения справочника по имени значения справочника
    :param refs: справочник
    :param name: имя значения справочника
    :return: -> код значения справочника
    """
    for ref in refs:
        if ref['title'] == name:
            return ref['code']
    return None


def getRefCodeByNameMany(refs: list, name: list):
    """
    Получение кодов значений справочника по списку имен значения справочника
    :param refs: справочник
    :param name: имя значения справочника
    :return: -> код значения справочника
    """

    return [ref["code"] for ref in refs if ref['title'] in name]


